import React from "react";

function Jumbotron({ children }) {
  return (
    <div
      style={{ width: "100%", height: 300, paddingTop: 120, textAlign: "center" }}
      className="jumbotron"
    >
      {children}
    </div>
  );
}

export default Jumbotron;
